import React, {useState} from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import MyNavbar from './Navbar/navbar'
import MyJumbotron from './Jumbotron/jumbotron'

function App(props) {
  const [calendarState, setcalenderState] = useState({
    persons: [
      {name: 'jaems', age: 12},
      {name: 'jaesdfms', age: 122}
    ],
    jumbotron: false
  });

  const hidJumbotronhandler = () => {
    setcalenderState({
      persons: [
        {name: 'jaems', age: 12},
        {name: 'jaesdfms', age: 122}
      ],
      jumbotron: !calendarState.jumbotron
    })

    console.log(calendarState.jumbotron)
  }



  return (
    <div>
      <MyNavbar/>
      <MyJumbotron click={hidJumbotronhandler}/>
    </div>
  );
}

export default App;
